import "./ServiceNous.css";
import map from "../../Images/map.png";
import guide from "../../Images/guide.png";
import organize from "../../Images/organize.png";
import securite from "../../Images/Securite.png";
import CardService from "../CardService/CardService";
function ServiceNous() {


    return (
        <>
            <section id="serc">
                <div className="container-fluid">
                    <div className="row">
                        <CardService
                            img={map}
                            title="Moyen de transport"
                            Lmoins="Notre association fournir des multiples moyens de transport tel que les..."
                            Lplus="Notre association fournir des multiples moyens de transport tel que les bus ou bien les mini bus aussi comme nous sommes une association on a le droit de profiter d'un remise pour les trains et les meteros notre objectif principal c'est de prenez soin du confort de notre visiteur."
                        ></CardService>

                        <CardService
                        img={guide}
                        title="Offre des guides"
                        Lmoins="Notre association fournir des guides réel et électronique bien selectioné..."
                        Lplus="Notre association fournir des guides réel et électronique bien selectioné et bien determiné quelque soit pour les guides réel qui offre des destination et des chemats attirant avec des programme bien orgainsé ou bien pour notre guide electronique qui offre des information sur le destionatin visité et la météo tous les jours."
                        ></CardService>
                        <CardService></CardService>
                        <CardService></CardService>

                    </div>
                </div>
            </section >
        </>
    );
}


export default ServiceNous;
